class ProductsImage {
  int? id;
  String? image;
  bool? isCover;
  int? priority;

  ProductsImage({this.id, this.image, this.isCover, this.priority});

  factory ProductsImage.(
      Map<String, dynamic> json) {
    return ProductsImage(
      id: json['id'] as int?,
      image: json['image'] as String?,
      isCover: json['isCover'] as bool?,
      priority: json['priority'] as int?,
    );
  }

  Map<String, dynamic>
      () {
    return {
      'id': id,
      'image': image,
      'isCover': isCover,
      'priority': priority,
    };
  }
}
